import { useState } from "react";
import { Navbar, Nav, Button, Container } from "react-bootstrap";

function NavMenu() {
  return (
    <Navbar expand="lg" className="custom-navbar py-0">
      <Container fluid>
        <Navbar.Brand href="#">
          <img src="/images/actual-logo.png" alt="Site Logo" width="232" />
        </Navbar.Brand>
        {/* Toggler button for small screens */}
        <Navbar.Toggle aria-controls="basic-navbar-nav" className="custom-toggler" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto w-100 d-flex justify-content-between">
            <Button variant="outline-info" size="lg" className="flex-grow-1 py-3 button-text no-round">
              CODING
            </Button>
            <Button variant="outline-success" size="lg" className="flex-grow-1 py-3 button-text no-round">
              COMICS
            </Button>
            <Button variant="outline-danger" size="lg" className="flex-grow-1 py-3 button-text no-round">
              CONTACT
            </Button>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavMenu;
